import Layout from "../Layout";

export default function FAQ() {
  return (
    <Layout>
      <div class="w-full h-screen flex justify-center">
        <div class="px-14 py-14 bg-lime-400 font-Plex w-full 2xl:container flex flex-col justify-center">
          <div class="w-64 h-48 bg-teal-500 shadow-md duration-75 transition-all hover:w-48 hover:h-64">
            <div class="p-4 text-sm">
              <div class="text-white mb-2 font-bold"> 01 . 05 . 2022</div>
              <div class="w-full h-48 p-3 rounded-lg text-center bg-orange-200 text-orange-200 hover:text-gray-900">
                <h3>NOTE</h3>
              </div>
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
}
